Hora de fazer a revolução silenciosa.
- DESLIGUEM SUAS TV´s, principalmente de canais abertos. São concessões estatais, portanto, trabalham para o sistema. Caso queiram assistir a um programa, use a internet;
- Não paguem impostos a vista, parcelem no máximo de vezes possivel;
- Retirem dinheiro da poupança, pois o governo exige que 55% de todo o dinheiro em poupança fique depositado no Banco Central;
- Não deixem dinheiro no banco, recebeu, retire;
- Diminua seu consumo em pelo menos 30%;
- Não vá viajar nas férias, principalmente para o Norte e Nordeste, esvazie as praias
- Feche sua conta no Banco do Brasil ou Caixa Econômica, Bradesco, Itaú e Santander; 
- *Não use as lotéricas e nem compre jogos da Caixa";
- Não vá a restaurantes bares, fast foods de esquerda. Esvazie todo e qualquer comércio de entretenimento de esquerda;
- Faça tipo a quarentena da covid, fique em casa e com isso, reduza seu consumo e por consequência os impostos;
- Boicote total ao Carnaval, maior fonte de roubalheira dos cofres publicos e artistas mamadores da Lei rouanet. Aquela lei que tira dinheiro do povo e sustenta a vida de luxo de artistas esquerdistas.
O SEU DINHEIRO sustenta esses vagabundos! Como vão fazer farra sem dinheiro nosso?
Compartilhem essa ideia. Converse com seus filhos sobre o que esta acontecendo. 
Estamos unidos nessa guerra.

